-- LocalScript: đặt trong StarterGui
local Players = game:GetService("Players")
local player = Players.LocalPlayer
local playerGui = player:WaitForChild("PlayerGui")


-- ============ GUI ============
-- Luôn tạo mới GUI nếu chưa có
-- Xóa GUI cũ nếu có
local AIChatGui = playerGui:FindFirstChild("AIChatGui")
if AIChatGui then
    AIChatGui:Destroy()
end

AIChatGui = Instance.new("ScreenGui")
AIChatGui.Name = "AIChatGui"
AIChatGui.ResetOnSpawn = false
AIChatGui.IgnoreGuiInset = true
AIChatGui.Parent = playerGui



local toggleButton = AIChatGui:FindFirstChild("ToggleButton")
if not toggleButton then
    toggleButton = Instance.new("TextButton")
    toggleButton.Name = "ToggleButton"
    toggleButton.Size = UDim2.new(0,100,0,35)
    toggleButton.Position = UDim2.new(0,20,0,200)
    toggleButton.Text = "AI Chat"
    toggleButton.BackgroundColor3 = Color3.fromRGB(60,60,60)
    toggleButton.TextColor3 = Color3.new(1,1,1)
    toggleButton.Parent = AIChatGui
end

local frame = AIChatGui:FindFirstChild("ChatFrame")
if not frame then
    frame = Instance.new("Frame")
    frame.Name = "ChatFrame"
    frame.Size = UDim2.new(0,260,0,380)
    frame.AnchorPoint = Vector2.new(0.5, 0.5)
    frame.Position = UDim2.new(0.5, 0, 0.5, 0)
    frame.BackgroundColor3 = Color3.fromRGB(40,40,40)
    frame.Visible = false
    frame.Parent = AIChatGui
    local corner = Instance.new("UICorner")
    corner.CornerRadius = UDim.new(0,12)
    corner.Parent = frame
end

toggleButton.MouseButton1Click:Connect(function()
    frame.Visible = not frame.Visible
end)

local chatBox = frame:FindFirstChild("ChatBox")
if not chatBox then
    chatBox = Instance.new("ScrollingFrame")
    chatBox.Name = "ChatBox"
    chatBox.Size = UDim2.new(1,-10,0.75,-10)
    chatBox.Position = UDim2.new(0,5,0,5)
    chatBox.BackgroundTransparency = 1
    chatBox.ScrollBarThickness = 6
    chatBox.CanvasSize = UDim2.new(0,0,0,0)
    chatBox.Parent = frame
    local UIList = Instance.new("UIListLayout")
    UIList.Padding = UDim.new(0,6)
    UIList.Parent = chatBox
    UIList.SortOrder = Enum.SortOrder.LayoutOrder
end
local UIList = chatBox:FindFirstChildOfClass("UIListLayout")

local input = frame:FindFirstChild("InputBox")
if not input then
    input = Instance.new("TextBox")
    input.Name = "InputBox"
    input.Size = UDim2.new(0.72,-8,0.18,-8)
    input.Position = UDim2.new(0,5,0.8,0)
    input.PlaceholderText = "Nhập tin nhắn..."
    input.Text = ""
    input.TextColor3 = Color3.new(1,1,1)
    input.BackgroundColor3 = Color3.fromRGB(70,70,70)
    input.Parent = frame
end

local sendBtn = frame:FindFirstChild("SendButton")
if not sendBtn then
    sendBtn = Instance.new("TextButton")
    sendBtn.Name = "SendButton"
    sendBtn.Size = UDim2.new(0.25,-5,0.18,-8)
    sendBtn.Position = UDim2.new(0.75,0,0.8,0)
    sendBtn.Text = "Gửi"
    sendBtn.BackgroundColor3 = Color3.fromRGB(100,100,100)
    sendBtn.TextColor3 = Color3.new(1,1,1)
    sendBtn.Parent = frame
end

-- ============ MODERATION ============
local bannedWords = {"sex","xxx","18+","porn","hentai","fuck","địt","đụ","cặc","lồn","buồi"}
local function containsBannedWord(msg)
    local lower = string.lower(msg)
    for _, w in ipairs(bannedWords) do
        if string.find(lower, w) then
            return true
        end
    end
    return false
end

