-- Hàm chọn câu trả lời
local function getResponse(msg)
    local lower = string.lower(msg)
    for key, list in pairs(responses) do
        if string.find(lower, key) then
            return list[math.random(1, #list)]
        end
    end
    return "Xin lỗi, mình chưa có câu trả lời cho câu này."
end

-- Gửi tin nhắn ra ChatBox
local function addMessage(sender, text)
    local label = Instance.new("TextLabel")
    label.Size = UDim2.new(1,-10,0,20)
    label.BackgroundTransparency = 1
    label.TextColor3 = Color3.new(1,1,1)
    label.TextXAlignment = Enum.TextXAlignment.Left
    label.TextWrapped = true
    label.Text = sender .. ": " .. text
    label.Parent = chatBox
    chatBox.CanvasSize = UDim2.new(0,0,0,UIList.AbsoluteContentSize.Y+10)
end

sendBtn.MouseButton1Click:Connect(function()
    local msg = input.Text
    if msg ~= "" then
        if containsBannedWord(msg) then
            addMessage("AI","Tin nhắn chứa từ cấm, bạn có thể bị ban.")
        else
            addMessage("Bạn", msg)
            local reply = getResponse(msg)
            addMessage("AI", reply)
        end
        input.Text = ""
    end
end)



-- Hàm tìm câu trả lời (khớp chính xác với câu hỏi)
local function findReply(text)
    local lower = string.lower(text)
    if responses[lower] then
        local list = responses[lower]
        return list[math.random(1,#list)]
    else
        return "Xin lỗi, mình chưa có câu trả lời cho: " .. text
    end
end
